                            Description = "Nestor kea (Nestor notabilis, maorsky jen kea) je alpinský papoušek z rodu Nestor obývající hornaté oblasti západní části Jižního ostrova Nového Zélandu. Jedná se o jediného alpinského papouška na světě a jednoho z nejinteligentnějších ptáků.Kea měří okolo 46 cm a váží 800–1000 g. Jeho peří je olivově zelené, pod křídly a na ocase přechází od žluté a červené až po modravou barvu. Je všežravec. Živí se převážně rostlinnou stravou (vedle listů pojídá i bobule, kořínky a nektar), kterou doplňuje larvami a savci. Napadání ovcí ho v minulosti dostalo do konfliktu s ovčími farmáři, novozélandská vláda v 60. letech 19. století dokonce vypsala odměnu za každého zabitého jedince. V následujících přibližně 100 letech bylo zabito až 150 000 papoušků kea. Od roku 1986 je nestor kea chráněný a od roku 2017 je veden na Červeném seznamu ohrožených druhů jako ohrožený taxon. Jeho populace se v roce 2020 odhadovala na 3000–7000 jedinců.Kea hnízdí v norách pod kořeny stromů a pod balvany, ve snůšce bývají 2–4 bílá vejce. Je znám svou inteligencí a zvědavostí, které mu umožňují přežít v extrémních podmínkách novozélandských Jižních Alp. Kea se naučil používat nástroje, umí vyřešit logické hlavolamy a dokáže pracovat i se statistickými problémy. V Bad Vöslau v Dolních Rakousích je výzkumné středisko, které se zabývá nestory kea a jejich inteligencí. Je chován v četných zoologických zahradách, v Česku je k vidění mj. v brněnské či pražské zoo.",
